import React from 'react';

import Header from '../common/Header';
import Footer from '../common/Footer';

class AdminDashboard extends React.Component{

    render(){
        return(
            <React.Fragment>
                <div class="sidenav">
  <a href="#">About</a>
  <a href="#">Services</a>
  <a href="#">Clients</a>
  <a href="#">Contact</a>
</div>
                 <Header/>
                 <div className="page-body row">
                    <div className="col">

                    </div>

                </div>
                <Footer></Footer>
            </React.Fragment>
        )  
    }
}

export default AdminDashboard;
